import React from "react";
import { Link } from "react-router-dom";
import { useState, useEffect } from "react";

const PostPage = () => {
  const [getPost, setPost] = useState([]);

  useEffect(() => {
    fetch("https://jsonplaceholder.typicode.com/users")
      .then((res) => res.json())
      .then((data) => {
        setPost(data);
      });
  }, []);
  console.log(getPost);

  return (
    <div className="contact">
      <div className="back">
        <Link to="/">
          <img
            src="https://image.shutterstock.com/image-vector/go-back-left-return-arrow-260nw-1452017738.jpg"
            alt=""
          />
        </Link>
      </div>
    </div>
  );
};

export default PostPage;
